import Grid from "@mui/material/Grid";

import SuiBox from "components/SuiBox";
import SuiTypography from "components/SuiTypography";
// Soft UI Dashboard PRO React example components
import DashboardLayout from "examples/LayoutContainers/DashboardLayout";
import DashboardNavbar from "examples/Navbars/DashboardNavbar";
// import Footer from "examples/Footer";
import Card from "@mui/material/Card";
import 'bootstrap/dist/css/bootstrap.min.css';

import SuiButton from "components/SuiButton";

// import { Link } from "react-router-dom";
import { useState } from "react";
import DataTable from "examples/Tables/DataTable";
import SuiSelect from "components/SuiSelect";


// import dataTableData from "layouts/ecommerce/orders/order-list/data/dataTableData";
// import Icon from "@mui/material/Icon";
import Menu from "@mui/material/Menu";
import MenuItem from "@mui/material/MenuItem";
import Divider from "@mui/material/Divider";

import ordertable from "layouts/authentication/error/ordertable";

function ChangePasswor() {

  const [menu, setMenu] = useState(null);

  // const openMenu = (event) => setMenu(event.currentTarget);
  const closeMenu = () => setMenu(null);

  const renderMenu = (
    <Menu
      anchorEl={menu}
      anchorOrigin={{ vertical: "bottom", horizontal: "left" }}
      transformOrigin={{ vertical: "top", horizontal: "left" }}
      open={Boolean(menu)}
      onClose={closeMenu}
      keepMounted
    >
      <MenuItem onClick={closeMenu}>Status: Paid</MenuItem>
      <MenuItem onClick={closeMenu}>Status: Refunded</MenuItem>
      <MenuItem onClick={closeMenu}>Status: Canceled</MenuItem>
      <Divider sx={{ margin: "0.5rem 0" }} />
      <MenuItem onClick={closeMenu}>
        <SuiTypography variant="button" textColor="error" fontWeight="regular">
          Remove Filter
        </SuiTypography>
      </MenuItem>
    </Menu>
  );

  const passwordRequirements = [

  ];

  const renderPasswordRequirements = passwordRequirements.map((item, key) => {
    const itemKey = `element-${key}`;

    return (

      <SuiBox key={itemKey} component="li" color="text" fontSize="1.25rem" lineHeight={1}>
        <SuiTypography
          variant="button"
          textColor="text"
          fontWeight="regular"
          verticalAlign="middle"
        >
          {item}
        </SuiTypography>
      </SuiBox>
    );
  });

  return (

    <DashboardLayout>
      <DashboardNavbar />

      <SuiBox p={2}>
        <Card id="profile">
          <SuiBox p={3}>
            <Grid container spacing={3} alignItems="center">
              <Grid item>
                <SuiBox height="100%" mt={0.5} lineHeight={1}>
                  <SuiTypography variant="h5" fontWeight="medium">
                    Order
                  </SuiTypography>
                </SuiBox>
              </Grid>
            </Grid>
          </SuiBox>
        </Card>
      </SuiBox>

      <Card id="change-password">
        <SuiBox display="flex" justifyContent="space-between" alignItems="flex-end" flexWrap="wrap">
          <SuiBox component="ul" m={0} pl={3.25} mb={{ xs: 8, sm: 0 }}>
            {renderPasswordRequirements}
          </SuiBox>

        </SuiBox>

        {/* </SuiBox> */}
        <SuiBox component="form" pb={3} px={3}>

          <Grid container spacing={3}>

            <Grid item xs={12}>
              <Grid container spacing={2}>

                <Grid item xs={12} sm={15}>
                  <Grid container spacing={3}>

                    <Grid item xs={12} sm={4}>
                      <SuiBox
                        display="flex"
                        flexDirection="column"
                        justifyContent="flex-end"
                        height="100%"
                      >
                        <SuiBox mb={1} ml={0.5} lineHeight={0} display="inline-block">
                          <SuiTypography
                            component="label"
                            variant="caption"
                            fontWeight="bold"
                            textTransform="capitalize"

                          >

                            Active/Cancelled
                          </SuiTypography>
                        </SuiBox>
                        <SuiSelect
                          placeholder="Select"
                          options={[
                            { value: "All", label: "All" },
                            { value: "Cancelled", label: "Cancelled" },
                            { value: "Active", label: "Active" },
                            { value: "your question", label: "", isDisabled: true },
                          ]}
                        />
                      </SuiBox>
                    </Grid>
                    <Grid item xs={12} sm={4}>
                      <SuiBox
                        display="flex"
                        flexDirection="column"
                        justifyContent="flex-end"
                        height="100%"
                      >
                        <SuiBox mb={1} ml={0.5} lineHeight={0} display="inline-block">
                          <SuiTypography
                            component="label"
                            variant="caption"
                            fontWeight="bold"
                            textTransform="capitalize"

                          >
                            Order Type
                          </SuiTypography>
                        </SuiBox>
                        <SuiSelect
                          placeholder="Select"
                          options={[
                            { value: "All ", label: "All" },
                            { value: "Monthly", label: "Monthly" },
                            { value: "One Time", label: "One Time" },
                            { value: "STP ", label: "STP" },
                            { value: "SWP", label: "SWP" },
                            { value: "Switch", label: "Switch" },
                            { value: "Redemption", label: "Redemption" },
                            { value: "your question", label: "", isDisabled: true },
                          ]}
                        />
                      </SuiBox>
                    </Grid>

                    <Grid item xs={12} sm={4}>
                      <SuiBox
                        display="flex"
                        flexDirection="column"
                        justifyContent="flex-end"
                        height="100%"
                      >
                        <SuiButton variant="gradient" buttonColor="dark" >
                          Submit
                        </SuiButton>
                      </SuiBox>
                    </Grid>
                  </Grid>

                </Grid>

              </Grid>
            </Grid>
          </Grid>


          <SuiBox display="flex" justifyContent="space-between" alignItems="flex-start" mb={2} >
            {/* <SuiButton variant="gradient" buttonColor="info">
                            new order
                        </SuiButton> */}
            <SuiBox display="flex">
              {/* <SuiButton
                                variant={menu ? "contained" : "outlined"}
                                buttonColor="dark"
                                onClick={openMenu}
                            >
                                filters&nbsp;
                                <Icon className="">keyboard_arrow_down</Icon>
                            </SuiButton> */}
              {renderMenu}
              <SuiBox ml={1}>
                {/* <SuiButton variant="outlined" buttonColor="dark">
                                    <Icon className="">description</Icon>
                                    &nbsp;export csv
                                </SuiButton> */}
              </SuiBox>
            </SuiBox>
          </SuiBox>
          <Card style={{ fontWeight: "bold" }}>
            <DataTable table={ordertable} entriesPerPage={false} canSearch />
          </Card>

        </SuiBox>

      </Card>

      <SuiBox p={2}>
        <Card id="change-password" style={{ fontWeight: "bold" }}>
          <SuiBox p={3}>
          <DataTable table={ordertable} entriesPerPage={false} canSearch />
          </SuiBox>
        </Card>
      </SuiBox>

    </DashboardLayout>
  );
}

export default ChangePasswor;
